import styled from 'styled-components'


export const Box = styled.div`
    border: solid;
    border-radius: 10px;
    background-color: #272727;
    border-color: #656565;
    color: #eeeff2;

    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;

    padding: 50px;
    margin: 10px;
`
